import React, { Component } from "react";

class Counter extends Component {
  state = {};
  render() {
    React.createElement("div");
    return (
      <React.Fragment>
        <h1> Press Below Button if you a Hoe </h1>
        <button>Increment</button>
      </React.Fragment>
    );
  }
}

export default Counter;
